// SPDX-License-Identifier: GPL-3.0-or-later
pragma solidity ^0.8.1;

import "./IGridToken.sol";
import "@openzeppelin/contracts/access/AccessControlEnumerable.sol";
import "@openzeppelin/contracts/token/ERC20/ERC20.sol";

contract GridToken is ERC20, AccessControlEnumerable {
    bytes32 public constant ROLE_OWNER = keccak256("ROLE_OWNER");
    bytes32 public constant ROLE_CORE_CONTRACT = keccak256("ROLE_CORE_CONTRACT");

    //we record the last block where a minting occurred so we can enforce a cooldown
    uint256 public lastMintingBlock;

    //minting can occur at maximum once every 200 blocks (~10 minutes on BSC with 3 second blocks)
    uint256 public constant mintingCooldown = 200;

    //constant amount of GRID created per block
    uint256 public constant GRIDPerBlock = 5e18;

    event Mint(address indexed recipient, uint256 amount);

    constructor() ERC20("Grid", "GRID") {
        _setupRole(ROLE_OWNER, msg.sender);
        _setupRole(DEFAULT_ADMIN_ROLE, msg.sender);

        //minting can begin [mintingCooldown] blocks after the contract creation
        lastMintingBlock = block.number;
    }

    /// We don't want someone to be able to accidentally send funds to this contract so we 
    /// ensure the fallback function is not payable
    fallback() external {}

    //introspect yourself, fool
    function supportsInterface(bytes4 interfaceId) public view virtual override(AccessControlEnumerable) returns (bool) {
        return interfaceId == type(IGridToken).interfaceId || super.supportsInterface(interfaceId);
    }

    //calculate the amount of minted tokens and subtract any that have been intentionally burned
    function getCirculatingSupply() external view returns (uint256 _circulatingAmount) {
        _circulatingAmount = totalSupply();

        //any tokens sent to common burn addresses can be checked to recalculate the circulating supply
        uint256 _burnedSupply = balanceOf(address(0)) + balanceOf(0x000000000000000000000000000000000000dEaD);

        if (_circulatingAmount > _burnedSupply){
            _circulatingAmount = _circulatingAmount - _burnedSupply;
        } else {
            _circulatingAmount = 0;
        }

        return _circulatingAmount;
    }

    //a minimum of (mintingCooldown * GRIDPerBlock) GRID tokens will be generated each time this successfully runs
    function mint() external onlyRole(ROLE_CORE_CONTRACT) returns (uint256 _mintedAmount) {
        require(
            block.number >= lastMintingBlock + mintingCooldown,
            "Minting cooldown is in effect"
        );

        //calculate the number of blocks that have elapsed since the last minting
        uint256 _blocksSinceLastMinting = block.number - lastMintingBlock;

        //calculate the amount to mint for the elapsed number of blocks
        _mintedAmount = _blocksSinceLastMinting * GRIDPerBlock;

        //start the cooldown again
        lastMintingBlock = block.number;

        //actually generate the tokens
        _mint(msg.sender, _mintedAmount);

        //let everyone know about it
        emit Mint(msg.sender, _mintedAmount);

        return _mintedAmount;
    }
}
